import React from 'react';

const transcation = props => {

    const removeTranscation = () => {
        props.removeTranscationById(props.transcation._id)
    }

    return (
        <div>
            {props.transcation.amount} {props.transcation.vendor} {props.transcation.category}
            <button onClick={removeTranscation}>Remove</button>
        </div>
    )
}

export default transcation
